import React from 'react';
import { Routes, Route, Link } from 'react-router-dom';
import AddTodos from './pages/new-todo.page'
import TodoList from './pages/new-todo.page';

function App() {

  return (
   <>
     
        <Routes>
          <Route path='/' element={<AddTodos/>}/>
          <TodoList/>
        </Routes> 
   </>
  );
}

export default App;
